        var yearContainer = jQuery("<div/>", {
            "class": "year-container"
        });

        var yearIcon = jQuery("<i/>", {
            "class": "fa fa-calendar"
        });

        var yearText = jQuery("<span/>", {
            "class": "year-text",
            "text": bornOnText
        });

        yearContainer.append(yearIcon);
        yearContainer.append(yearText);
